import React from 'react';
import logo from '../img/logo.jpeg'
import './index.css'
export default function Navbar() {
  return (
    <div className='navbar'>
      <img src={logo}  alt='' />
      <ul className='nav-menu'>
        <li>SingUp</li>
        <li>SignIn</li>
        <li>Profile</li>
      </ul>
    </div>
  )
}
